#dOORS REALTED fucntions
def function_to_save_and_move_out_from_exclusive_To_read_only():

    #clicks on the file open in the doors menu
    pag.click(DOORS_FILE_X, DOORS_FILE_Y, clicks=1,duration=0.5,button="left")

    #clicks on the save option from file menu
    pag.click(DOORS_SAVE_X, DOORS_SAVE_Y, clicks=2,duration=0.5,button="left")

    #waiting time for the saving the changes
    tm.sleep(3)

    #Clicks on the edit option from doors menu
    pag.click(DOORS_EDIT_X, DOORS_EDIT_Y, clicks=2,duration=0.5,button="left")

    #clicks on the editmode option from the edit menu
    pag.click(DOORS_EDIT_MODE_X, DOORS_EDIT_MODE_Y, clicks=1,duration=0.5,button="left")

    #clicks on the ready only mode 
    pag.click(DOORS_READ_ONLY_X, DOORS_READ_ONLY_Y, clicks=1,duration=1,button="left")







#SWIS_MAC related functions
def Start_linking_function_SWIS_MAC(server_port):

    #location of SWIS_MAC
    pag.click(SWIS_MAC_X, SWIS_MAC_Y, clicks=1,duration=0,button="left")
    tm.sleep(0.5)
    #function call to get the port to start link
    Find_object_Id_in_SWIS_MAC(server_port)
    #click on start link
    pag.click(SWIS_START_LINK_X, SWIS_START_LINK_Y, clicks=1,duration=0,button="left")
    tm.sleep(0.5)

def Find_object_Id_in_SWIS_MAC(Id):

    #click on Edit
    pag.click(SWIS_EDIT_X, SWIS_EDIT_Y, clicks=1,button="left")
    #click on goto
    pag.click(SWIS_GOTO_X, SWIS_GOTO_Y, clicks=1,button="left")
    #double click to select all the text
    pag.click(SWIS_GOTO_X_CURSOR, SWIS_GOTO_Y_CURSOR, clicks=2,duration=0.5,button="left")
    #write the id to search
    pag.write(Id)
    #click on goto button
    pag.click(SWIS_GOTO_BUTTON_X, SWIS_GOTO_BUTTON_Y, clicks=1,duration=0.5,button="left")
    #search waiting time
    tm.sleep(0.5)

#SST_LAH_TME related functions
def Make_linking_From_start_function_SST_LAH_TME(Port):

    #location of SST_LAH_TME
    pag.click(SST_LAH_TME_X, SST_LAH_TME_Y, clicks=1,duration=0,button="left")
    tm.sleep(1)
    #function call to get the port to make the link from start
    Find_object_Id_in_SST_LAH_TME(Port)
    #click pn make link form start
    pag.click(SST_LAH_TME_MAKE_LINK_X, SST_LAH_TME_MAKE_LINK_Y, clicks=1,duration=0,button="left")
    tm.sleep(0.5)

def Find_object_Id_in_SST_LAH_TME(Id):

    #click on Edit
    pag.click(SST_LAH_TME_EDIT_X, SST_LAH_TME_EDIT_Y, clicks=1,duration=0,button="left")
    #click on goto
    pag.click(SST_LAH_TME_GOTO_X, SST_LAH_TME_GOTO_Y, clicks=1,duration=0,button="left")
    #double click to select all the text
    pag.click(SST_LAH_TME_GOTO_X_CURSOR, SST_LAH_TME_GOTO_Y_CURSOR, clicks=2,duration=0.5,button="left")
    #write the id to search
    pag.write(Id)
    #click on goto button
    pag.click(SWIS_GOTO_BUTTON_X, SWIS_GOTO_BUTTON_Y, clicks=1,duration=0.5,button="left")
    #search waiting time
    tm.sleep(0.5)






